I try to use the following code to convert svs file to dzi, but it throw error `no such operation dzsave VipsOperation: class "dzsave" not found`.

What should I do to fix this problem?

```ts
import Vips from 'wasm-vips';

let vipsInstance: typeof Vips;

async function init() {
  if (vipsInstance) {
    return vipsInstance;
  }
  vipsInstance = await Vips();
  console.log('Worker thread initialized with Vips instance.');
  return vipsInstance;
}

async function runCmd(
  slide_path: string,
  dzi_path: string
): Promise<{ code: number; error?: string }> {
  try {
    const vips = await init();

    const image = vips.Image.newFromFile(slide_path);

    const options = {
      tile_size: 256,
      overlap: 0,
      suffix: '.jpeg',
      layout: 'dz',
    };

    image.dzsave(dzi_path, options);

    return { code: 0 };
  } catch (err: any) {
    return { code: 1, error: err.message };
  }
}

